Condition : 2 - Notwithstanding the details shown on the approved plans and set out in the supporting documents, details habitat creation and biodiversity enhancements shall be provided prior to commencement of any above ground works. This shall include, but is not limited to:
a)	details of wildlife friendly planting
b)	details of the semi-intensive biodiverse roof, standard biodiverse roof and biosolar roof, including details of extensive substrate base, features to be included within the substrate e.g. rope coils, sand, gravel, etc., and details of any seed and seeding/plug plant choice (in accordance with The Gro Green Roof Code 2021);
c)	orientation, target species and location for all bird and bat boxes/ bricks to be integrated with the new buildings; 
d)	details of invertebrate features;
e)	a sensitive post-construction lighting plan to ensure that any lighting will be of a specification that minimises its impacts on bats, any onsite habitats and the adjacent railway lines in accordance with the BCT and ILP 2018 Guidance Note.
It will also include a management plan to be implemented, which shall include long-term design objectives; management responsibilities and maintenance schedules for all hard and soft landscaped areas as well as the above-mentioned measures to provide biodiversity gain. The approved details shall be implemented prior to first occupation of the development and maintained thereafter.
Reason: To enhance the ecological interest of the site and to ensure that the ecological features are provided and maintained in a satisfactory manner in accordance with Local Plan policy LP55 and London Plan policy G6.
